import React from 'react';
import './Portfolio.css';
import 'animate.css';
import 'tachyons';


const Portfolio = () => {
  const style ={backgroundImage: 'url(http://mrmrs.github.io/images/0006.jpg)'}
  return (
    <section className="cf w-100 pa2-ns">
      <article className="fl w-100 w-50-m  w-25-ns pa2-ns">
        <div className="aspect-ratio aspect-ratio--1x1">
          <img style={style} className="db bg-center cover aspect-ratio--object"></img>
        </div>
        <a href="#0" className="ph2 ph0-ns pb3 link db">
          <h3 className="f5 f4-ns mb0 black-90">Title of piece</h3>
          <h3 className="f6 f5 fw4 mt2 black-60">Subtitle of piece</h3>
        </a>
      </article>

    </section>


  )
}

export default Portfolio;
